public int active()
{
    int ret;

    ret = super();

    if (ret)
    {
        if (LogisticsElectronicAddress.isNewRecord())
        {
            LogisticsElectronicAddress_Locator.label("@SYS60248");
            LogisticsElectronicAddress_LocatorExtension.visible(true);
        }
        else
        {
            switch(LogisticsElectronicAddress.Type)
            {
                case LogisticsElectronicAddressMethodType::Phone:
                    LogisticsElectronicAddress_Locator.label(enum2str(LogisticsElectronicAddressMethodType::Phone));
                    break;
                case LogisticsElectronicAddressMethodType::Email:
                    LogisticsElectronicAddress_Locator.label(enum2str(LogisticsElectronicAddressMethodType::Email));
                    LogisticsElectronicAddress_LocatorExtension.visible(false);
                    break;
                case LogisticsElectronicAddressMethodType::Fax:
                    LogisticsElectronicAddress_Locator.label(enum2str(LogisticsElectronicAddressMethodType::Fax));
                    LogisticsElectronicAddress_LocatorExtension.visible(false);
                    break;
                case LogisticsElectronicAddressMethodType::Telex:
                    LogisticsElectronicAddress_Locator.label(enum2str(LogisticsElectronicAddressMethodType::Telex));
                    LogisticsElectronicAddress_LocatorExtension.visible(false);
                    break;
                case LogisticsElectronicAddressMethodType::URL:
                    LogisticsElectronicAddress_Locator.label(enum2str(LogisticsElectronicAddressMethodType::URL));
                    LogisticsElectronicAddress_LocatorExtension.visible(false);
                    break;
            }
        }

    }
    return ret;
}

