void clicked()
{
    Args args = new Args();
    FormRun                 formRunContacts;
    super();
    args.record(DirPartyTable);
    formRunContacts = new MenuFunction(menuItemDisplayStr(HMPatientContacts), MenuItemType::Display).create(args);
    formRunContacts.run();
}
